          semanticsSLRgrammar _grammar ;
          _grammar.nt_semantics_component_start_symbol_ (*scanner_, parameter_1) ;
          if (_inSentStringPtr != NULL) {
            _inSentStringPtr->dotAssign_operation (scanner_->sentString ()) ;
          }
